css:
.minimap .highlight-selected {
  -webkit-transform-origin: top left;
}
.minimap .marker .region {
  position: absolute;
  pointer-events: none;
}
.minimap .highlight-selected .marker .region {
  border-radius: 2px;
  box-sizing: content-box;
  padding: 0 0px;
  margin: -1px 0 0 0;
  background-color: #000000;
}
